sourcesContent:
const express = require('express');
const PORT = process.env.PORT || 3001 ;
const knex = require('./knex/knex.js')
const app = express();
const environment = process.env.NODE_ENV || 'development';
const configuration = require('./knexfile')[environment];
const database = require('knex')(configuration);

const {parse} = require('csv-parse');
const fs = require('node:fs');
const {finished} = require('stream/promises');


const processFile = async () => {
  const records = [];
  const parser = fs
    .createReadStream('csv/branded_food1.csv')
    .pipe(parse({relax_quotes: true, skip_records_with_error: true}));
  parser.on('readable', function(){
    let record; while ((record = parser.read()) !== null) {
    // Work with each record
      records.push(record);
    }
  });

  await finished(parser);
  return records;
};

app.get('/', async (req,res) => {
    try {
        const records = await processFile();
        const brandedFoodObjects = records.map(record => {
          return {fdc_id:record[0], brand_owner:record[1],brand_name:record[2], subbrand_name:record[3], gtin_upc:record[4], ingredients:record[5],
            not_a_significant_source_of:record[6], serving_size:record[7], serving_size_unit:record[8], household_serving_fulltext:record[9],
            branded_record_category:record[10], data_source:record[11], package_weight:record[12], modified_date:record[13], available_date:record[14],
            market_country:record[15], discontinued_date:record[16], preparation_state_code:record[17], trade_channel:record[18], short_description:record[19]}
          })
        for (var i =0; i < 11; i++) {
            console.log(brandedFoodObjects[i])
        }
        // const foods = await database('food').select();
        // console.log(foods)
        // res.status.json(foods);
        res.send('hello');
    }
    catch (error){
        res.status(500).json({error});
    }
})
app.listen(PORT, () => {
    console.log(`Listening on port: ${PORT}`)
})

